def _freeze(thing):
    if isinstance(thing, dict):
        return frozenset([(_freeze(k), _freeze(v)) for k, v in thing.items()])

    elif isinstance(thing, list):
        return tuple([_freeze(i) for i in thing])

    return thing

# check that there are no duplicates
with test.features_in_tile_layer(9, 245, 166, 'landuse') as landuse:
    feature_props = set()

    for feature in landuse:
        p = feature['properties'].copy()

        # ignore label placements
        if p.get('label_placement'):
            continue

        # ignore ID, area when checking for uniqueness
        p.pop('id', None)
        p.pop('area', None)

        props = frozenset(_freeze(p))
        if props in feature_props:
            test.fail('Duplicate properties %r in landuse layer, but properties '
                 'should be unique (except ID, area).' % feature['properties'])
        feature_props.add(props)
